import{_ as a}from"./chunks/v5_nano_01.BFDPyset.js";import{_ as t,a as e}from"./chunks/cuav_nano_debug_cable.eKZAWBB0.js";import{_ as r,c as l,o,ab as i}from"./chunks/framework.CUflZczI.js";const k=JSON.parse('{"title":"Автопілот CUAV V5 nano","description":"","frontmatter":{},"headers":[],"relativePath":"uk/flight_controller/cuav_v5_nano.md","filePath":"uk/flight_controller/cuav_v5_nano.md"}'),d={name:"uk/flight_controller/cuav_v5_nano.md"},n=i('<h1 id="автопілот-cuav-v5-nano" tabindex="-1">Автопілот CUAV V5 nano <a class="header-anchor" href="#автопілот-cuav-v5-nano" aria-label="Permalink to &quot;Автопілот CUAV V5 nano&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">PX4 не виробляє цей (або будь-який інший) автопілот. Зверніться до <a href="https://store.cuav.net/" target="_blank" rel="noreferrer">виробника</a> щодо питань технічної підтримки або відповідності вимогам.</p></div><p><strong>V5 nano</strong><sup>®</sup> є автопілотом для просторово обмежених застосувань, розробленим CUAV<sup>®</sup>у співпраці з командою PX4.</p><p>Автопілот досить малий, щоб використовувати в гоночних дронах розміром 220 мм, але залишається достатньо потужним для більшості використань дрона.</p><p><img src="'+a+'" alt="V5 nano - Hero image"></p><div class="info custom-block"><p class="custom-block-title">V5 nano подібний до <a href="./../flight_controller/cuav_v5_plus.html">CUAV V5+</a>, але має форм-фактор все в одному, менше PWM-портів (не може бути використаний для <a href="./../airframes/airframe_reference.html">корпусів</a>, які використовують AUX-порти), і не має внутрішнього демпфування.</p></div><p>Деякі з його основних функцій включають:</p><ul><li>Повна сумісність зі стандартом проєкту <a href="https://pixhawk.org/" target="_blank" rel="noreferrer">Pixhawk</a> <strong>FMUv5</strong> і використовує <a href="https://pixhawk.org/pixhawk-connector-standard/" target="_blank" rel="noreferrer">Pixhawk Connector Standard</a> для всіх зовнішніх інтерфейсів.</li><li>Більш продуктивний процесор, оперативна пам&#39;ять та флеш-пам&#39;ять, ніж у FMU v3, разом із більш стабільними та надійними датчиками.</li><li>Прошивка сумісна з PX4.</li><li>Велика відстань між контактами вводу/виводу 2,6 мм, що полегшує використання всіх інтерфейсів.</li></ul><div class="info custom-block"><p class="custom-block-title">Цей польотний контролер <a href="./../flight_controller/autopilot_manufacturer_supported.html">підтримується виробником</a>.</p></div><h3 id="короткии-опис" tabindex="-1">Короткий опис <a class="header-anchor" href="#короткии-опис" aria-label="Permalink to &quot;Короткий опис&quot;">​</a></h3><p>Основний процесор FMU: STM32F765◦32 Bit Arm® Cortex®-M7, 216MHz, 2MB пам&#39;яті, 512KB RAM</p><ul><li><p>Сенсори на платі:</p><ul><li>Акселератор/гіроскоп: ICM-20689</li><li>Акселератор/гіроскоп: ICM-20602</li><li>Акселератор/гіроскоп: BMI055</li><li>Магнітометр: IST8310</li><li>Барометр: MS5611</li></ul></li><li><p>Інтерфейси: 8 виходів PWM</p><ul><li>3 виділених PWM/Capture входи на FMU</li><li>Виділений R/C вхід для CPPM</li><li>Виділений вхід R/C для Spektrum / DSM і S.Bus</li><li>Аналоговий / PWM вхід RSSI</li><li>4 загальних послідовних порти</li><li>3 I2C порти</li><li>4 SPI шини</li><li>2 CAN шини</li><li>Аналогові входи для напруги / струму з батареї</li><li>2 додаткових аналогових входи</li><li>Підтримка nARMED</li></ul></li><li><p>Система енергопостачання: вхід Power Brick: 4,75~5,5В</p></li><li><p>Вхід USB Power: 4.75~5.25V</p></li><li><p>Вага та розміри:</p><ul><li>Розміри: 60*40*14mm</li></ul></li><li><p>Інші характеристики:</p><ul><li>Робоча температура: -20 ~ 85°С (виміряне значення)</li></ul></li></ul><h2 id="де-купити" tabindex="-1">Де купити <a class="header-anchor" href="#де-купити" aria-label="Permalink to &quot;Де купити&quot;">​</a></h2><p><a href="https://store.cuav.net/shop/v5-nano/" target="_blank" rel="noreferrer">Магазин CUAV</a></p><p><a href="https://www.aliexpress.com/item/33050770314.html?storeId=3257035&amp;spm=2114.12010612.8148356.9.dbe6790bjW2hpH" target="_blank" rel="noreferrer">CUAV Aliexpress</a> (міжнародні користувачі)</p><p><a href="https://item.taobao.com/item.htm?spm=a230r.1.14.8.26ab5258veQJRu&amp;id=569404317857&amp;ns=1&amp;abbucket=13#detail" target="_blank" rel="noreferrer">CUAV Taobao</a> (користувачі з материкового Китаю)</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Автопілот можна придбати з модулем Neo GPS в комплекті</p></div><p><a id="connection"></a></p><h2 id="з-єднання-проводка" tabindex="-1">З&#39;єднання (Проводка) <a class="header-anchor" href="#з-єднання-проводка" aria-label="Permalink to &quot;З&#39;єднання (Проводка)&quot;">​</a></h2><p><a href="./../assembly/quick_start_cuav_v5_nano.html">V5 nano Wiring Quickstart</a></p><h2 id="схема-розташування-виводів" tabindex="-1">Схема розташування виводів <a class="header-anchor" href="#схема-розташування-виводів" aria-label="Permalink to &quot;Схема розташування виводів&quot;">​</a></h2><p>Завантажте схему розводки <strong>V5 nano</strong> <a href="http://manual.cuav.net/V5-Plus.pdf" target="_blank" rel="noreferrer">звідси</a>.</p><h2 id="збірка-прошивки" tabindex="-1">Збірка прошивки <a class="header-anchor" href="#збірка-прошивки" aria-label="Permalink to &quot;Збірка прошивки&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Більшості користувачів не потрібно збирати цю прошивку! Вона попередньо зібрана й автоматично встановлюється <em>QGroundControl</em> при підключенні відповідного апаратного забезпечення.</p></div><p>Щоб <a href="./../dev_setup/building_px4.html">зібрати PX4</a> для цієї цілі:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>make px4_fmu-v5_default</span></span></code></pre></div><p><a id="debug_port"></a></p><h2 id="відладочнии-порт" tabindex="-1">Відладочний порт <a class="header-anchor" href="#відладочнии-порт" aria-label="Permalink to &quot;Відладочний порт&quot;">​</a></h2><p>Системна консоль <a href="./../debug/system_console.html">PX4</a> та інтерфейс <a href="./../debug/swd_debug.html">SWD</a> працюють через порт <strong>FMU Debug</strong> (<code>DSU7</code>). Плата не має інтерфейсу відладки вводу/виводу.</p><p><img src="'+t+'" alt="Debug port (DSU7)"></p><p>Відладочний порт (<code>DSU7</code>) використовує роз&#39;єм <a href="https://www.digikey.com.au/product-detail/en/jst-sales-america-inc/BM06B-GHS-TBT-LF-SN-N/455-1582-1-ND/807850" target="_blank" rel="noreferrer">JST BM06B</a> і має наступну розводку:</p><table><thead><tr><th>Pin</th><th>Сигнал</th><th>Вольт</th></tr></thead><tbody><tr><td>1 (red)</td><td>5V+</td><td>+5V</td></tr><tr><td>2 (blk)</td><td>DEBUG TX (OUT)</td><td>+3.3V</td></tr><tr><td>3 (blk)</td><td>DEBUG RX (IN)</td><td>+3.3V</td></tr><tr><td>4 (blk)</td><td>FMU_SWDIO</td><td>+3.3V</td></tr><tr><td>5 (blk)</td><td>FMU_SWCLK</td><td>+3.3V</td></tr><tr><td>6 (blk)</td><td>GND</td><td>GND</td></tr></tbody></table><p>До комплекту поставки входить зручний відладочний кабель, який можна під&#39;єднати до порту <code>DSU7</code>. Він розділяє кабель FTDI для підключення <a href="./../debug/system_console.html">PX4 System Console</a> до USB-порту комп&#39;ютера і виводи SWD, які використовуються для налагодження SWD/JTAG. Відладочний кабель, що входить до комплекту, не підключається до контакту (1) порту SWD <code>Vref</code>.</p><p><img src="'+e+'" alt="CUAV Debug cable"></p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Вивід Vref SWD (1) використовує 5В як Vref, але процесор працює при напрузі 3,3В!</p><p>Деякі JTAG-адаптери (SEGGER J-Link) використовують напругу Vref для встановлення напруги на лініях SWD. Для прямого підключення до <em>Segger Jlink</em> ми рекомендуємо використовувати 3,3 вольта з контакту 4 роз&#39;єму з позначкою <code>DSM</code>/<code>SBUS</code>/<code>RSSI</code> для забезпечення <code>Vtref</code> на JTAG (тобто для забезпечення 3,3 В і <em>NOT</em> 5 В).</p><p>За додатковою інформацією звертайтесь до розділу <a href="#using-jtag-for-hardware-debugging">Використання JTAG для апаратної налагодження</a>.</p></div><h2 id="зіставлення-послідовних-портів" tabindex="-1">Зіставлення послідовних портів <a class="header-anchor" href="#зіставлення-послідовних-портів" aria-label="Permalink to &quot;Зіставлення послідовних портів&quot;">​</a></h2><table><thead><tr><th>UART</th><th>Пристрій</th><th>Порт</th></tr></thead><tbody><tr><td>UART1</td><td>/dev/ttyS0</td><td>GPS</td></tr><tr><td>USART2</td><td>/dev/ttyS1</td><td>TELEM1 (керування потоком)</td></tr><tr><td>USART3</td><td>/dev/ttyS2</td><td>TELEM2 (керування потоком)</td></tr><tr><td>UART4</td><td>/dev/ttyS3</td><td>TELEM4</td></tr><tr><td>USART6</td><td>/dev/ttyS4</td><td>TX - RC-вхід з роз&#39;єму SBUS_RC</td></tr><tr><td>UART7</td><td>/dev/ttyS5</td><td>Debug Console</td></tr><tr><td>UART8</td><td>/dev/ttyS6</td><td>Не підключено (без PX4IO)</td></tr></tbody></table><h2 id="номінальна-напруга" tabindex="-1">Номінальна напруга <a class="header-anchor" href="#номінальна-напруга" aria-label="Permalink to &quot;Номінальна напруга&quot;">​</a></h2><p><em>V5 nano</em> повинен живитися від роз&#39;єму <code>Power</code> під час польоту, а також може живитися від <code>USB</code> для стендового тестування.</p><div class="info custom-block"><p class="custom-block-title">Роз&#39;єм <code>PM2</code> не може не використовуватися для живлення <em>V5 nano</em> (див. <a href="#compatibility_pm2">цей матеріал</a>).</p></div><div class="info custom-block"><p class="custom-block-title">Серворейка не живиться від FMU і не забезпечує його живленням. Однак, контакти, позначені <strong>+</strong>, є загальними, і до будь-якого з наборів контактів серводвигуна може бути підключений BEC для живлення рейки живлення серводвигуна.</p></div><h2 id="захист-від-перенапруги" tabindex="-1">Захист від перенапруги <a class="header-anchor" href="#захист-від-перенапруги" aria-label="Permalink to &quot;Захист від перенапруги&quot;">​</a></h2><p><em>V5 nano</em> не має захисту від перевищення струму.</p><p><a id="Optional-hardware"></a></p><h2 id="периферіині-пристроі" tabindex="-1">Периферійні пристрої <a class="header-anchor" href="#периферіині-пристроі" aria-label="Permalink to &quot;Периферійні пристрої&quot;">​</a></h2><ul><li><a href="https://item.taobao.com/item.htm?spm=a1z10.3-c-s.w4002-16371268452.37.6d9f48afsFgGZI&amp;id=9512463037" target="_blank" rel="noreferrer">Цифровий датчик швидкості польоту</a></li><li><a href="https://cuav.taobao.com/category-158480951.htm?spm=2013.1.w5002-16371268426.4.410b7a821qYbBq&amp;search=y&amp;catName=%CA%FD%B4%AB%B5%E7%CC%A8" target="_blank" rel="noreferrer">Телеметричні радіо модулі</a></li><li><a href="./../sensor/rangefinders.html">Далекоміри / Датчики відстані</a></li></ul><h2 id="підтримувані-платформи-планери" tabindex="-1">Підтримувані платформи / планери <a class="header-anchor" href="#підтримувані-платформи-планери" aria-label="Permalink to &quot;Підтримувані платформи / планери&quot;">​</a></h2><p>Будь-який мультикоптер / літак / наземна платформа / човен, який може керуватися звичайними RC сервоприводами або сервоприводами Futaba S-Bus. Повний набір підтримуваних конфігурацій можна переглянути в розділі <a href="./../airframes/airframe_reference.html">Довідник про планери</a>.</p><h2 id="сумісність" tabindex="-1">Сумісність <a class="header-anchor" href="#сумісність" aria-label="Permalink to &quot;Сумісність&quot;">​</a></h2><p>CUAV використовує деякі відмінні дизайни і несумісний з деяким обладнанням, про що буде описано нижче.</p><p><a id="compatibility_gps"></a></p><h4 id="neo-v2-0-gps-несуміснии-з-іншими-пристроями" tabindex="-1">Neo v2.0 GPS несумісний з іншими пристроями <a class="header-anchor" href="#neo-v2-0-gps-несуміснии-з-іншими-пристроями" aria-label="Permalink to &quot;Neo v2.0 GPS несумісний з іншими пристроями&quot;">​</a></h4><p>Рекомендований для використання з <em>CUAV V5+</em> та <em>CUAV V5 nano</em> <em>Neo v2.0 GPS</em> не є повністю сумісним з іншими контролерами польоту Pixhawk (зокрема, частина дзвіночка несумісна і можуть виникнути проблеми з безпечним перемикачем).</p><p>Пристрій прийому GNSS UAVCAN <a href="http://doc.cuav.net/gps/neo-series-gnss/en/neo-v2-pro.html" target="_blank" rel="noreferrer">NEO V2 PRO</a> також може бути використаний і сумісний з іншими контролерами польоту.</p><p><a id="compatibility_jtag"></a></p><h4 id="використання-jtag-для-апаратного-налагодження" tabindex="-1">Використання JTAG для апаратного налагодження <a class="header-anchor" href="#використання-jtag-для-апаратного-налагодження" aria-label="Permalink to &quot;Використання JTAG для апаратного налагодження&quot;">​</a></h4><p><code>DSU7</code> Штифт налагодження FMU 1 має напругу 5 вольтів - не 3,3 вольта від ЦП.</p><p>Деякі JTAG-зонди використовують це напругу для встановлення рівнів введення-виведення при спілкуванні з цільовим об&#39;єктом.</p><p>Для прямого підключення до <em>Segger Jlink</em> ми рекомендуємо використовувати 3,3 вольти з DSM/SBUS/RSSI пін 4 як Пін 1 на роз&#39;ємі для налагодження (<code>Vtref</code>).</p><p><a id="compatibility_pm2"></a></p><h4 id="pm2-не-може-живити-модульнии-політнии-контролер" tabindex="-1">PM2 не може живити модульний політний контролер <a class="header-anchor" href="#pm2-не-може-живити-модульнии-політнии-контролер" aria-label="Permalink to &quot;PM2 не може живити модульний політний контролер&quot;">​</a></h4><p><code>PM2</code> може вимірювати лише напругу батареї та струм, але <strong>не</strong> живить контролер польоту.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 не підтримує цей інтерфейс.</p></div><h2 id="відомі-проблеми" tabindex="-1">Відомі проблеми <a class="header-anchor" href="#відомі-проблеми" aria-label="Permalink to &quot;Відомі проблеми&quot;">​</a></h2><p>Проблеми нижче посилаються на <em>номер партії</em>, в якій вони вперше з&#39;являються. Номер партії - це чотирицифрова дата виробництва за V01 та відображається на наклейці з боку контролера польоту. Наприклад, серійний номер партії V011904 ((V01 - це номер V5, 1904 - це дата виробництва, тобто номер партії).</p><p><a id="pin1_unfused"></a></p><h4 id="інтерфеис-sbus-dsm-rssi-pin1-не-захищении-від-перевантаження" tabindex="-1">Інтерфейс SBUS / DSM / RSSI Pin1 не захищений від перевантаження <a class="header-anchor" href="#інтерфеис-sbus-dsm-rssi-pin1-не-захищении-від-перевантаження" aria-label="Permalink to &quot;Інтерфейс SBUS / DSM / RSSI Pin1 не захищений від перевантаження&quot;">​</a></h4><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Це питання безпеки.</p></div><p>Будь ласка, не підключайте інше обладнання (крім RC приймача) до інтерфейсу SBUS / DSM / RSSI - це може призвести до пошкодження обладнання!</p><ul><li><em>Знайдено:</em> Партії V01190904xxxx</li><li><em>Виправлено:</em> Партії пізніше, ніж V01190904xxxx</li></ul><h2 id="додаткова-інформація" tabindex="-1">Додаткова інформація <a class="header-anchor" href="#додаткова-інформація" aria-label="Permalink to &quot;Додаткова інформація&quot;">​</a></h2><ul><li><a href="http://manual.cuav.net/V5-nano.pdf" target="_blank" rel="noreferrer">Посібник з V5 nano</a> (CUAV)</li><li><a href="https://docs.google.com/spreadsheets/d/1-n0__BYDedQrc_2NHqBenG1DNepAgnHpSGglke-QQwY/edit#gid=912976165" target="_blank" rel="noreferrer">Схема роз&#39;ємів для посилання на FMUv5</a> (CUAV)</li><li><a href="https://github.com/cuav" target="_blank" rel="noreferrer">CUAV Github</a> (CUAV)</li><li><a href="./../frames_multicopter/dji_f450_cuav_5nano.html">Журнал збірки конструкції повітряного каркасу за допомогою CUAV v5 nano на рамі DJI FlameWheel450</a></li></ul>',72),s=[n];function p(c,h,m,u,b,f){return o(),l("div",null,s)}const v=r(d,[["render",p]]);export{k as __pageData,v as default};
